<p class="MarginalNote"><span class="wb-invisible">Marginal note:</span>Delivery of articles of incorporation</p><p class="Section" id="108513"><strong><a class="sectionLabel" id="s-7"><span class="sectionLabel">7</span></a></strong> An incorporator shall send to the Director articles of incorporation and the documents required by sections 19 and 106.</p><div class="HistoricalNote"><ul class="HistoricalNote"><li class="HistoricalNoteSubItem">1974-75-76, c. 33, s. 7</li><li class="HistoricalNoteSubItem"> 1978-79, c. 9, s. 1(F)</li></ul></div>
